import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faHome, faProjectDiagram, faUsers, faCog, faFile, faSearch, faBell, faUser } from '@fortawesome/free-solid-svg-icons';
import './People.css';
import profileImage from './image/profile.jpg';
const Sidebar = () => {
  return (
    <div className="sidebar">
      <div className="profile">
        <img src="path/to/profile.jpg" alt="Profile" />
        <span>Bruce Wayne</span>
      </div>
      <ul>
        <li><FontAwesomeIcon icon={faHome} /> Overview</li>
        <li><FontAwesomeIcon icon={faProjectDiagram} /> Organization</li>
        <li><FontAwesomeIcon icon={faUsers} /> Projects</li>
        <li><FontAwesomeIcon icon={faUsers} /> People</li>
        <li><FontAwesomeIcon icon={faFile} /> Example</li>
        <li><FontAwesomeIcon icon={faCog} /> Settings</li>
      </ul>
    </div>
  );
};

const Header = () => {
  return (
    <div className="header">
      <h1>People</h1>
      <div className="search">
        <FontAwesomeIcon icon={faSearch} />
        <input type="text" placeholder="Search" />
      </div>
      <div className="icons">
        <FontAwesomeIcon icon={faBell} />
        <FontAwesomeIcon icon={faUser} />
      </div>
    </div>
  );
};

const users = [
  { id: '#CM9801', name: 'Natali Craig', project: 'Landing Page', email: 'natalirc@mail.com', date: 'Just now', status: 'In Progress' },
  { id: '#CM9801', name: 'Kate Morrison', project: 'CRM Admin pages', email: 'katemorr@gmail.com', date: 'A minute ago', status: 'Complete' },
  { id: '#CM9801', name: 'Drew Cano', project: 'Client Project', email: 'bagwell@mail.co', date: '1 hour ago', status: 'Pending' },
  { id: '#CM9801', name: 'Natali Craig', project: 'Admin Dashboard', email: 'washburnbaton@o..', date: 'Yesterday', status: 'Approved' },
  { id: '#CM9801', name: 'Andi Lane', project: 'App Landing Page', email: 'nest32@gmail.com', date: 'Feb 2, 2024', status: 'Rejected' },
  { id: '#CM9801', name: 'Orlando Diggs', project: 'Landing Page', email: 'meadow_oakland....', date: 'Just now', status: 'Complete' },
];

const UserList = () => {
  return (
    <div className="user-list">
      <table>
        <thead>
          <tr>
            <th>User ID</th>
            <th>User</th>
            <th>Project</th>
            <th>Email</th>
            <th>Date</th>
            <th>Status</th>
          </tr>
        </thead>
        <tbody>
          {users.map(user => (
            <tr key={user.id}>
              <td>{user.id}</td>
              <td>{user.name}</td>
              <td>{user.project}</td>
              <td>{user.email}</td>
              <td>{user.date}</td>
              <td>{user.status}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

const notifications = [
  { message: 'You fixed a bug.', time: 'Just now' },
  { message: 'New user registered.', time: '59 minutes ago' },
  { message: 'You fixed a bug.', time: '12 hours ago' },
  { message: 'Andi Lane subscribed to you.', time: 'Today, 11:59 AM' },
];

const Notifications = () => {
  return (
    <div className="notifications">
      <h3>Notifications</h3>
      <ul>
        {notifications.map((notif, index) => (
          <li key={index}>
            <span>{notif.message}</span>
            <span>{notif.time}</span>
          </li>
        ))}
      </ul>
    </div>
  );
};

const activities = [
  { message: 'Changed the style.', time: 'Just now' },
  { message: 'Released a new version.', time: '59 minutes ago' },
  { message: 'Submitted a bug.', time: '12 hours ago' },
  { message: 'Modified A data in Page X.', time: 'Today, 11:59 AM' },
  { message: 'Deleted a page in Project X.', time: 'Feb 2, 2024' },
];

const Activities = () => {
  return (
    <div className="activities">
      <h3>Activities</h3>
      <ul>
        {activities.map((activity, index) => (
          <li key={index}>
            <span>{activity.message}</span>
            <span>{activity.time}</span>
          </li>
        ))}
      </ul>
    </div>
  );
};

const contacts = [
  'Natali Craig',
  'Drew Cano',
  'Andi Lane',
  'Koray Okumus',
  'Kate Morrison',
];

const Contacts = () => {
  return (
    <div className="contacts">
      <h3>Contacts</h3>
      <ul>
        {contacts.map((contact, index) => (
          <li key={index}>{contact}</li>
        ))}
      </ul>
    </div>
  );
};

const People = () => {
  return (
    <div className="people">
      <Sidebar />
      <div className="main-content">
        <Header />
        <div className="content">
          <UserList />
          <div className="right-sidebar">
            <Notifications />
            <Activities />
            <Contacts />
          </div>
        </div>
      </div>
    </div>
  );
};

export default People;
